package co.ceiba.domain;

public class Person {
	
	private String name;
	private String lastName;
	
	public Person() {
		// TODO Auto-generated constructor stub
	}

	public String getName() {
		return name;
	}

	public String getLastName() {
		return lastName;
	}

	public Person(String name, String lastName) {
		super();
		this.name = name;
		this.lastName = lastName;
	}
	
	

}
